 const fruits = [
   {id: 5, name: "apple", color: "red"},
   {id: 6, name: "lychee", color: "orange"},
   {id: 7, name: "mango", color: "golden"}
  ];

 const Fruit = ({name, color}) => <div> I am a {color} {name} </div>

function App() {
  return (
    <div>
      { fruits.map(fruit => <Fruit name={fruit.name} color={fruit.color} />  )  }
    </div>
  );
}

export default App;
